import React from 'react';
import './cell.styles.scss';

const Cell = ({isStart, isGoal, obstacle, inPath}) => {
    console.log(obstacle);
    return(
        <span className={`${isStart ? 'start' : ''} 
                          ${isGoal ? 'goal' : ''} 
                          ${inPath ? 'path' : ''} 
                          ${obstacle ? 'obstacle' : ''} 
                          cell`} >
            {isStart ? 'Wall-e' : null}
            {isGoal ? 'Eve' : null}
        </span>
    );
}

export default Cell;
